window.bookSummaryJSON = "<p><b>Don’t miss the epic conclusion to The Youngbloods serial novella trilogy—a nonstop thrill ride brimming with dark humor, romance, and sinister suspense!</b></p> <p>As a mafia-like demon family trapped on Earth, the Youngbloods have seen their share of family drama...but it’s never been like this before.&nbsp;While they battle the secret society trying to destroy them, Petra Youngblood must choose who she loves most. Will her loyalty lie with her family or with Killian Irons, the human she’s fallen in love with, whose family is hell-bent on eradicating her own?</p> <p>Complicating matters further, a long-hidden secret is about to come to light.&nbsp;Ora Youngblood has been holding out on the clan. And what they’re about to discover will change their understanding of themselves—and their mission on Earth—forever.</p>"; 
